import React from "react";
import Header from "./Header";
import Tech from "../Assets/service.png";
export default function TechSupport() {
    return(
        <>
            <Header/>
            <div className="page">
                <h2>24/7 Customer Service</h2>
                <h4>If you need instant support please use live chat<br/> we can respond quickly</h4>
                <img src={Tech} alt="customer service"/>
                    <footer>
                        <i className="bi bi-envelope-at"></i><span>brandnewshop@gmail.com</span>
                        <i className="bi bi-telephone-fill"></i><span>+1 123-456-7890</span>
                    </footer>
            </div>
        </>
    )
}
